---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: hm-airbyte-secret
  namespace: production-hm-airbyte
  annotations:
    # https://argo-cd.readthedocs.io/en/stable/user-guide/resource_hooks
    argocd.argoproj.io/hook: PreSync
  labels:
    app.kubernetes.io/name: hm-airbyte-secret
    app.kubernetes.io/part-of: production-hm-airbyte
spec:
  encryptedData:
    AIRBYTE_ADMIN_EMAIL: 
    AIRBYTE_ADMIN_PASSWORD: 
    AWS_ACCESS_KEY_ID: 
    AWS_SECRET_ACCESS_KEY: 
    AIRBYTE_LOG_S3_BUCKET_NAME: 
    LOG_S3_BUCKET_REGION: 
    POSTGRES_PASSWORD: 
    POSTGRES_USER_NAME: 
  template:
    metadata:
      name: production-hm-airbyte-secret
      namespace: production-hm-airbyte
      annotations:
        # https://argo-cd.readthedocs.io/en/stable/user-guide/resource_hooks
        argocd.argoproj.io/hook: PreSync
      labels:
        app.kubernetes.io/name: hm-airbyte-secret
        app.kubernetes.io/part-of: production-hm-airbyte
